const page = computed({
  get: () => {
    return props.page;
  },
  set: (val) => {
    emits("update:modelValue", val);
  },
});

const updateSeo = async () => {
  const update = { ...page.value };
  apiUpdate(`/api/_/pages/${update.id}`, update).then(res => {
    if (res.success) {
      showMessage(res.message);
    } else {
      showMessage(res.result, "connextError");
    }
  });
};
</script>
